import React from "react";
import "./card.css";

const card = ({ property, image }) => {
  console.log(property, image);
  return (
    <article className="card_article">
      <img src={image} alt={property.title} />
      <div className="card_title">{property.title}</div>
    </article>
  );
};

export default card;
